def extrap(n):
	a = [n]
	while not all(i == 0 for i in n):
		n = [b-a for a,b in zip(n[:-1],n[1:])]
		a.append(n)
	return sum(i[-1] for i in a)
print(sum(extrap(i) for i in dat))

def extrap2(n):
	a = [n]
	while not all(i == 0 for i in n):
		n = [b-a for a,b in zip(n[:-1],n[1:])]
		a.append(n)
	x = 0
	for i in reversed(a):
		x = i[0] - x
	return x
#print([extrap2(i) for i in dat])
print(sum(extrap2(i) for i in dat))
